import React from 'react';

function Box(props){
    const clickMe = () => {
        alert("안녕하세요!");
    }
    return (
        <div className="box">
            {props.name}<br></br>
            {props.major}
            <button onClick={clickMe}>BUTTON</button>
        </div>
    )
}

export default Box //Box라는 컴포넌트를 추출할 준비 완료
